import React from 'react'

import PropTypes from 'prop-types'

import './browseco.css'

const Browseco = (props) => {
  return (
    <div className="browseco-container">
      <h1>{props.heading}</h1>
    </div>
  )
}

Browseco.defaultProps = {
  heading: 'Browse here',
}

Browseco.propTypes = {
  heading: PropTypes.string,
}

export default Browseco
